-- Drop the database if it exists
IF EXISTS (SELECT name FROM sys.databases WHERE name = 'WFOTest3')
BEGIN
    USE master;
    ALTER DATABASE WFOTest3 SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
    DROP DATABASE WFOTest3;
END
GO

-- Create the database
CREATE DATABASE WFOTest3;
GO

USE WFOTest3;
GO

-- Create tutorials table
IF OBJECT_ID('tutorials', 'U') IS NOT NULL
    DROP TABLE tutorials;
GO

CREATE TABLE tutorials (
    id BIGINT IDENTITY(1,1) PRIMARY KEY,
    title NVARCHAR(255),
    description NVARCHAR(MAX),
    published BIT
);
GO

-- Create tutorial_rankings table
IF OBJECT_ID('tutorial_rankings', 'U') IS NOT NULL
    DROP TABLE tutorial_rankings;
GO

CREATE TABLE tutorial_rankings (
    id BIGINT IDENTITY(1,1) PRIMARY KEY,
    tutorial_id BIGINT,
    scrore BIGINT,
    description NVARCHAR(MAX),
    CONSTRAINT FK_TutorialRanking_Tutorial FOREIGN KEY (tutorial_id) REFERENCES tutorials(id)
);
GO

SET IDENTITY_INSERT tutorials ON;
SET IDENTITY_INSERT tutorials OFF;
